import axios from "axios";
import React, { useContext, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { authContext } from "../contexts/AuthContext";

const Sidebar = function () {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [favorites, setFavorites] = useState([]);

  const navigate = useNavigate();

  const userContext = useContext(authContext);

  const onChangeEmail = (event) => {
    setEmail(event.target.value);
  };
  const onChangePassword = (event) => {
    setPassword(event.target.value);
  };

  const handleLogin = (e) => {
    e.preventDefault();
    axios
      .post("/api/users/login", {
        email: email,
        password: password,
      })
      .then((res) => res.data)
      .then((user) => userContext.toggleAuth(user))
      .catch((err) => console.log(err));
  };

  const handleLogout = (e) => {
    e.preventDefault();
    axios
      .post("/api/users/logout")
      .then((user) => userContext.toggleAuth(null))
      .then(() => navigate("/"))
      .catch((err) => console.log(err));
  };


  useEffect(() => {
    axios
      .request({
        method: "GET",
        url: "https://api.themoviedb.org/3/movie/" + id,
        headers: {
          accept: "application/json",
          Authorization:
            "Bearer eyJhbGciOiJIUzI1NiJ9.eyJhdWQiOiI0M2FlY2E1NmZkNGJiOTYzNDRlY2Q2MjFiY2Y3NGUyYiIsInN1YiI6IjY0ZWNiMDBiYzNjODkxMDExZGEwMGEzZCIsInNjb3BlcyI6WyJhcGlfcmVhZCJdLCJ2ZXJzaW9uIjoxfQ.PPqHm4cNxjZOFznfEKNaofQd6mIfaurqCtu9loSm8VE",
        },
      })
      .then((response) => setData(response.data))
      .catch(function (error) {
        console.error(error);
      });
  }, [id]);


  const handleFavorites = (e) => {
    e.preventDefault();
    axios
      .get(`/api/favorites/${userContext.user.id}`)
      .then((result) => setFavorites(result.data))
      .catch((err) => console.log(err));
  };

  console.log("userContext-->", userContext);

  return !userContext.isAuthenticated ? (
    <aside className="menu column is-one-fifth">
      <div className="is-flex is-justify-content-space-between">
        <p className="menu-label has-text-weight-bold">LOGIN</p>
        {/* <Link to="/new-playlist">
        <button className="button is-success is-small">NEW</button>
      </Link> */}
      </div>
      <div className="container">
        <form onSubmit={handleLogin}>
          <div className="field">
            <label className="label">Email</label>
            <div className="control">
              <input
                onChange={onChangeEmail}
                className="input"
                type="email"
                placeholder="e.g. alexsmith@gmail.com"
              />
            </div>
          </div>
          <div className="field">
            <label className="label">Password</label>
            <div className="control">
              <input
                onChange={onChangePassword}
                className="input"
                type="password"
                placeholder="e.g Alex Smith"
              />
            </div>
          </div>
          <button className="button is-dark">Login</button>
          <p>OR</p>
        </form>
        <Link to="/register">
          <button className="button is-dark">Register</button>
        </Link>
      </div>
    </aside>
  ) : (
    <aside className="menu column is-one-fifth">
      <div className="is-flex is-justify-content-space-between">
        <p className="menu-label has-text-weight-bold">
          HELLO {userContext.user.username}!
        </p>
        {/* <Link to="/logout"> */}
        <button onClick={handleLogout} className="button is-success is-small">
          Logout
        </button>
        {/* </Link> */}
      </div>
      <br></br>
      <div className="is-flex is-justify-content-space-between">
        <p className="menu-label has-text-weight-bold">Your favorites list</p>
      </div>
      <div>

      </div>
    </aside>
  );
};

export default Sidebar;
